import './Nav.css'
import { Link } from 'react-router-dom';
const Nav = () => {
    return (
        <div>
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/title2">News</Link></li>
                <li><Link to="/contact">Contact</Link></li>
                <li><Link class="active" to="/about">About</Link></li>
            </ul>
        </div>
    );
  }
  
  export default Nav;
